public BorrowService(com.example.library.Library library, com.example.library.services.NotificationService notificationService) {
    this.library = library;
    this.notificationService = notificationService;
}

public boolean returnBook(java.lang.String userId, java.lang.String bookId) {
    com.example.library.models.User user = library.findUserById(userId);
    com.example.library.models.Book book = library.findBookById(bookId);
    book.setBorrowed(false);
    notificationService.sendNotification(user, "You have returned the book: " + book.getTitle());
    return true;
}

public boolean borrowBook(java.lang.String userId, java.lang.String bookId) {
    com.example.library.models.User user = library.findUserById(userId);
    com.example.library.models.Book book = library.findBookById(bookId);
    if (((user != null) && (book != null)) && (!book.isBorrowed())) {
        book.setBorrowed(true);
        notificationService.sendNotification(user, "You have borrowed the book: " + book.getTitle());
        return true;
    }
    return false;
}

